import React from 'react'

interface Article {
    id: number;
    title: string;
    description: String;
  }

function ArticleList(props: { articles: Article[]; }) {
  return (
    <div>
        {props.articles.map((article: Article) => {
            return (
            <div key={article.id}>
                <h2>{article.title}</h2>
                <p>{article.description}</p>
            </div>
        )
      })}
    </div>
  )
}

export default ArticleList
